import React,{useState} from 'react';
import {
    Container,
    Form,
    FormGroup,
    Label,
    Input
}from 'reactstrap';
import {useForm} from '../Hooks/useForm';

export const Forms=()=>{
    const [value,handleChange]=useForm({name:'',college:''});
    // const [name,setName]=useState('');
    // const [college,setCollege]=useState('');

    // const onChange=(e)=>{
    //     return(
    //         setState([e.target.name]=e.target.value)
    //     )
    // }
    return(
        <Container>
            <Form>
                <FormGroup>
                    <Label>Name</Label>
                    <Input type='text' onChange={handleChange} value={value.name}/>
                    <Label>College</Label>
                    <Input type="text" onChange={handleChange} value={value.college}/>
                </FormGroup>
            </Form>
        </Container>
    )
}
